import React,{Component} from 'react'
import axios from 'axios';



class PostFormCons extends Component {



  addC=(e)=>{
     const url = 'http://127.0.0.1:8000/consultations/'
     const formData = new FormData();

     formData.append('date', document.querySelector('#date').value);
     formData.append('type', document.querySelector('#type').value);
     formData.append('desc', document.querySelector('#desc').value);
     formData.append('outcome', document.querySelector('#outcome').value);
     formData.append('name', document.querySelector('#name').value);


     axios.post(url, formData)
     .then(resp => {
         console.log(resp.data);
     });


 }



  render(){

return(

<div className='PostFormCons'>
<form  className='PostFormmCons' >
<div className='pst' >
   <label for='date'> date:</label>
    <input type='date'id='date'   />
    </div>
    <div className='pst' >
    <label for='type'> type : </label>
    <input type='text'id='type' />
    </div>
    <div className='pst' >
     <label for='desc'> description : </label>
    <input type='text' id="desc"/>
      </div>
      <div className='pst' >
    <label for='outcome'> outcome : </label>
    <input type='text'id='outcome' />
   </div>
   <div className='pst' >
 <label for='name'> name: </label>
 <input type='text'id='name' />
</div>
    

</form>
<button type='submit' onClick={this.addC}>submit</button>
</div>


)}
}
export default PostFormCons;
